import React from 'react';
import { NavbarContainer, Logo, MenuItem, SearchBlock } from './Navbar.style';

const Navbar = () => {
    return (
        <NavbarContainer>
            <Logo>My Logo</Logo>
            <SearchBlock></SearchBlock>
            <MenuItem>Services</MenuItem>
            <MenuItem>Contact</MenuItem>
        </NavbarContainer>
    );
};

export default Navbar;
